import ThreeShels from "./ThreeShels";
const Bookshels = ({ props }) => {
    const Cr = props.book.filter((bb)=> bb.shelf === "currentlyReading")
    const Wr = props.book.filter((bb)=> bb.shelf === "WantTo")
  const titles = ["Currently Reading", "Want to Read", "Read"];
  return (
    <div className="list-books">
      <div className="list-books-content">
        <ThreeShels title={titles[0]} book={props.book} />
      </div>
    </div>
  );
};

export default Bookshels;
